### 注解详解

#### @id 注解

标识主键字段，支持以下生成策略：

```idl
// UUID生成
id: String @id @default(uuid())

// 自增ID
id: Long @id @default(autoIncrement())

// UUID生成
id: String @id @default(uuid())

// 不自动生成
id: String @id
```

#### @default 注解

设置字段默认值：

```idl
// 字符串默认值
status: String @default("active")

// 数字默认值
count: Int @default(0)

// 布尔默认值
enabled: Boolean @default(true)

// 函数默认值
createdAt: DateTime @default(now())
```

